.
Mt. Baker has been somewhat of a North Star for me for decades. Living in Vancouver, BC I would see him looming in the distance while on the highway driving with my parents to our various destinations, and eventually in my own car. They‚Äôd always point him out, ‚ÄúLook, Mt. Baker is out today - isn‚Äôt he beautiful?‚Äù
.
Living in Bellingham, WA, I got even closer to him. Now he was also in the background of most of my high elevation hikes. Almost a joke at times, because I always look for him in the horizon no matter what mountain in the cascades I find myself in. More often than not if visibility is good, you‚Äôll find him in the distance. And of course living in Bellingham, a lot of my hiking is oriented in the areas surrounding Baker as well. So many things in my life have changed, but this mountain is a constant.
.
So when I needed to escape to a place that still felt like home today, I was drawn here. I hiked in silence alone and meditated on my feelings of sadness, anger and powerlessness. I let myself feel the heavy feelings that came to me and I sat with them. I tried to ground myself with the beautiful surroundings and the calmness of the forest, lakes and mountains. I asked questions and listened for answers.
.
It didn‚Äôt magically make things better, but it reminded me to stay positive, stay grateful, and always look for the light. And no matter what‚Äôs happening, this mountain will be here üèî
.
.
